import React, { Component } from 'react'

export default class Login extends Component {
  render() {
    return (
      <div className='container'>
        <form className='form-control'>
           <div className='m-3'>
           <label htmlFor="ExampilInputEmail" className='form-lable'> yourEmail</label>
           </div>
        </form>
      </div>
    )
  }
}
